import React from "react";
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col';

const Nav: Button = (props: any) => {

    const content = () => {props.content}

    return(
      <Container>
          <Col>
            <h2>Qwik</h2>
        </Col>
        {content()}
      </Container>
  );
};

export default Nav;
